const magnifier = {
    image: null,
    zoom: null,
    glass: null,
    get width() {
        return this.glass.offsetWidth / 2;
    },
    get height() {
        return this.glass.offsetHeight / 2;
    },
    magnify(imageId, zoom) {
        this.image = document.getElementById(imageId);
        this.zoom = zoom;

        // Create a magnifier glass.
        this.glass = document.createElement('div');
        this.glass.classList.add('img-magnifier-glass');
        // Insert magnifier glass.
        this.image.parentElement.insertBefore(this.glass, this.image);
        // Set background properties for the magnifier glass.
        this.glass.style.cssText = `
          background: url('${this.image.src}') no-repeat;
          transition: ease all 0s !important;
          background-size: ${this.image.width * this.zoom}px ${this.image.height *
        this.zoom}px;
      `;

        /*execute a function when someone moves the magnifier glass over the image:*/
        this.glass.addEventListener('mousemove', this.moveMagnifier.bind(this));
        this.image.addEventListener('mousemove', this.moveMagnifier.bind(this));
    },

    moveMagnifier(event) {
        event.preventDefault();
        let { x, y } = this.getCursorPos(event);

        /*prevent the magnifier glass from being positioned outside the image:*/
        if (x > this.image.width - this.width / this.zoom) {
            x = this.image.width - this.width / this.zoom;
        }
        if (x < this.width / this.zoom) {
            x = this.width / this.zoom;
        }
        if (y > this.image.height - this.height / this.zoom) {
            y = this.image.height - this.height / this.zoom;
        }
        if (y < this.height / this.zoom) {
            y = this.height / this.zoom;
        }

        /*set the position of the magnifier glass:*/
        this.glass.style.left = x - this.width + 'px';
        this.glass.style.top = y - this.height + 'px';
        /*display what the magnifier glass "sees":*/
        this.glass.style.backgroundPosition =
            '-' +
            (x * this.zoom - this.width) +
            'px -' +
            (y * this.zoom - this.height) +
            'px';
    },

    getCursorPos(event) {
        event = event || window.event;
        /*get the x and y positions of the image:*/
        const { left, top } = this.image.getBoundingClientRect();
        /*calculate the cursor's x and y coordinates, relative to the image:*/
        let x = event.pageX - left;
        let y = event.pageY - top;
        /*consider any page scrolling:*/
        x = x - window.pageXOffset;
        y = y - window.pageYOffset;
        return { x, y };
    }
};
